import Typography from '@mui/material/Typography'
import './index.css'



const Tag:React.FC<{due:Date}>=(props)=>{
  
    const {due}=props
  const d = new Date();
  const diff= due.getTime() - d.getTime(); 
  const No_Days=  Math.ceil(diff / (1000 * 60 * 60 * 24));  

    return(
<div className='style'>
    <Typography variant='body2'>Due in {No_Days} day(s)</Typography>
</div>
    )
}

export default Tag
